    [],nt"revision_timestamp": "2015-05-07T01:01:54.383679",nt"name": "spectroscopic-dosimeter-project-a41c0",nt"isopen":
    true,nt"url": null,nt"notes": "Analysis of Phase I test data demonstrates
    that the Photogenics Spectroscopic Dosimeter will detect neutron energies from 0.8
    up to 600 MeV. The detector efficiencies in the energy region of interest to NASA
    of 0.5 to 150 MeV were predicted by MCNP-X models.  These models were partially
    confirmed by the tests at the EAL and LANSCE, with a high confidence in the data
    for the 1-14 MeV range and a confirmation of the detector's spectroscopic capabilities
    between 15-150 MeV.   Further analysis of the high energy data will be performed
    in Phase II.rnUsing the detection efficiencies determined Phase I and the IRCP74
    damage coefficients, doses have been calculated for the neutron fluxes encountered
    in the test facilities.  During Phase II a full-scale working model of the spectroscopic
    dosimeter will be fabricated and tested.",nt"license_title": "U.S. Government
